import React from "react";
import { useNavigate } from "react-router-dom";


const Dashboard = () => {
  const navigate = useNavigate();
  const [interviews, setInterviews] = useState([]);

  useEffect(() => {
    // Fetch previous interviews from API
    const fetchInterviews = async () => {
      const response = await fetch("http://localhost:8000/interviews");
      const data = await response.json();
      setInterviews(data);
    };
    fetchInterviews();
  }, []);

  return (
    // <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
    //   <h1 className="text-4xl font-bold text-gray-800">Welcome to Your Dashboard</h1>
    //   <p className="text-lg text-gray-600 mt-4">
    //     Here you can track your interviews, progress, and improvements.
    //   </p>

    //   <button
    //     onClick={() => navigate("/profile-update")}
    //     className="mt-6 px-6 py-3 bg-blue-600 text-white rounded-lg text-lg font-semibold hover:bg-blue-700 transition"
    //   >
    //     Update Profile
    //   </button>
    // </div>


    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center text-gray-800 mb-6">Interview Dashboard</h1>
      <div className="max-w-4xl mx-auto bg-white p-6 rounded-2xl shadow-lg">
        <Table>
          <TableHeader>
            <TableRow>
              <TableHead>Date</TableHead>
              <TableHead>Score</TableHead>
              <TableHead>Feedback</TableHead>
            </TableRow>
          </TableHeader>
          <TableBody>
            {interviews.map((interview) => (
              <TableRow key={interview.id}>
                <TableCell>{new Date(interview.date).toLocaleDateString()}</TableCell>
                <TableCell>
                  <Progress value={interview.score} className="w-24" />
                </TableCell>
                <TableCell>{interview.feedback}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </div>
    </div>
  );
};

export default Dashboard;
